import './Contact.css';

const Contact = () => {
  return (
    <div className="">
      <article className="pa4 bg-black-10 w-100">
        <a href="mailto:" class="link b f3 f2-ns dim black-70 lh-solid">info@ristolina.com</a>
      </article>

    </div>
  )
}

export default Contact;
